import React from "react";
import { Typography, TextField, Grid ,Button } from "@mui/material";
import "./App.css";
import logo from "./images/light-logo.png";

function App() {
  const popupStyle = {
    backgroundColor: "rgb(100, 64, 189)",
    width: "25%",
    height: "90vh",
  };

  const textFieldStyle = {
    backgroundColor: "white",
    marginTop: "10px", // Reduce the top margin for the password field
    width: "300px",
    borderRadius: "20px",
  };

  return (
    <div className="App" style={popupStyle}>
      <img style={{ width: "200px", margin: "20px" }} src={logo} alt="logo" />
      <Typography>Sign in to your account</Typography>

      <TextField
        id="outlined-basic"
        label="Enter your email..."
        variant="outlined"
        style={textFieldStyle}
      />
      <div style={{ marginLeft: "250px", marginTop: "10px" }}>Forgot?</div>
      <TextField
        id="outlined-basic"
        label="Enter your password..."
        variant="outlined"
        style={textFieldStyle}
      />

      <Grid container justifyContent="space-evenly" style={{ marginTop: "30px" }}>
        <Typography>
          No Account ?
        </Typography>
        <Typography>
          Sign Up
        </Typography>
        <Grid item>
          <Button style={{ backgroundColor:"white" , width:"" }}>Sign In</Button>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
